import { Route, useParams } from "react-router-dom";
import Comments from "../components/comments/Com"
function QuoteDetail() {
  const params = useParams();
  return (
    <section>
      <h1>QuoteDetail</h1>
      <p>{params.quoteId}</p>
      <Route path={`/quotes/${params.quoteId}/comments`} >
        <Comments />
      </Route>
    </section>
  );
}

export default QuoteDetail;
